  return (
    <div className='carrouselContainer'>
      <div className='div'> 

        <Carousel fade>
          <Carousel.Item>
            <img
              className="d-block w-100 naranjo"
              src={frutales}
              alt="First slide"
              />
          </Carousel.Item>
          <Carousel.Item>
            <img
              className="d-block w-100"
              src={cerco}
              alt="Second slide"
              />
          </Carousel.Item>
